import { useState } from 'react';
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import ErrorOutlineRoundedIcon from '@material-ui/icons/ErrorOutlineRounded';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles'
import styles from './styles'

const useStyles = makeStyles(styles);

const ConfirmPopup = () => {
  const classes = useStyles()
  const [open, setOpen] = useState(true)

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Dialog className={classes.root} open={open}>
      <DialogContent className={classes.content}>
        <ErrorOutlineRoundedIcon className={classes.icon}/>
        <Typography component="h3" variant="h6" className={classes.description}>Apakah Anda yakin menghapus activity "Meeting dengan Client"</Typography>

        <div role="actions" className={classes.action}>
          <Button onClick={handleClose} className={classes.btnCancel}>Batal</Button>
          <Button className={classes.btnSubmit}>Hapus</Button>
        </div>
      </DialogContent>
    </Dialog>
  )
}

export default ConfirmPopup
